class Solution(object):
    def findPrimePairs(self, n):
        def sieve(n):
            prime = [True for _ in range(n+1)]
            p = 2
            while (p * p <= n):
                if (prime[p] == True):
                    for i in range(p * 2, n+1, p):
                        prime[i] = False
                p += 1
            return [p for p in range(2, n+1) if prime[p]]

        primes = sieve(n)
        result = []
        i, j = 0, len(primes) - 1
        while i <= j:
            if primes[i] + primes[j] == n:
                result.append([primes[i], primes[j]])
                i += 1
                j -= 1
            elif primes[i] + primes[j] < n:
                i += 1
            else:
                j -= 1
        return result
